webpackJsonp([0x14dbcbce4cad7e00],{"./node_modules/json-loader/index.js!./.cache/json/sql-sql-where-clause.json":function(e,n){e.exports={data:{markdownRemark:{html:'<h2>SQL Where Clause</h2>\n<h3><code>WHERE</code> Clause (and/or, <code>IN</code>, <code>BETWEEN</code>, and <code>LIKE</code>)</h3>\n<p>The <code>WHERE</code> clause is used to limit the number of rows returned.  </p>\n<p>In this case all five of these will be used is a some what ridiculous <code>WHERE</code> clause. </p>\n<p>Here is the current full student list to compare to the <code>WHERE</code> clause result set:</p>\n<div class="gatsby-highlight">\n      <pre class="language-sql"><code><span class="token keyword">select</span> studentID<span class="token punctuation">,</span> FullName<span class="token punctuation">,</span> sat_score<span class="token punctuation">,</span> rcd_updated <span class="token keyword">from</span> student<span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code>+-----------+------------------------+-----------+---------------------+\n| studentID | FullName               | sat_score | rcd_updated         |\n+-----------+------------------------+-----------+---------------------+\n|         1 | Monique Davis          |       400 | 2017-08-16 15:34:50 |\n|         2 | Teri Gutierrez         |       800 | 2017-08-16 15:34:50 |\n|         3 | Spencer Pautier        |      1000 | 2017-08-16 15:34:50 |\n|         4 | Louis Ramsey           |      1200 | 2017-08-16 15:34:50 |\n|         5 | Alvin Greene           |      1200 | 2017-08-16 15:34:50 |\n|         6 | Sophie Freeman         |      1200 | 2017-08-16 15:34:50 |\n|         7 | Edgar Frank "Ted" Codd |      2400 | 2017-08-16 15:35:33 |\n|         8 | Donald D. Chamberlin   |      2400 | 2017-08-16 15:35:33 |\n|         9 | Raymond F. Boyce       |      2400 | 2017-08-16 15:35:33 |\n+-----------+------------------------+-----------+---------------------+\n9 rows in set (0.00 sec)</code></pre>\n      </div>\n<p>Rows will be presented that…</p>\n<ul>\n<li><code>WHERE</code> Student IDs are between 1 and 5 (inclusive) </li>\n<li><code>OR</code> studentID = 8 </li>\n</ul>\n<p>Here’s an updated query, where any record that has an SAT score that’s in this list (1000, 1400) will not be presented:</p>\n<div class="gatsby-highlight">\n      <pre class="language-sql"><code><span class="token keyword">select</span>  studentID<span class="token punctuation">,</span> FullName<span class="token punctuation">,</span> sat_score<span class="token punctuation">,</span> recordUpdated\n<span class="token keyword">from</span>    student\n<span class="token keyword">where</span>   <span class="token punctuation">(</span>studentID <span class="token operator">between</span> <span class="token number">1</span> <span class="token operator">and</span> <span class="token number">5</span> <span class="token operator">or</span> studentID <span class="token operator">=</span> <span class="token number">8</span><span class="token punctuation">)</span>\n        <span class="token operator">and</span>\n        sat_score <span class="token operator">NOT</span> <span class="token operator">in</span> <span class="token punctuation">(</span><span class="token number">1000</span><span class="token punctuation">,</span> <span class="token number">1400</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code>+-----------+----------------------+-----------+---------------------+\n| studentID | FullName             | sat_score | rcd_updated         |\n+-----------+----------------------+-----------+---------------------+\n|         1 | Monique Davis        |       400 | 2017-08-16 15:34:50 |\n|         2 | Teri Gutierrez       |       800 | 2017-08-16 15:34:50 |\n|         4 | Louis Ramsey         |      1200 | 2017-08-16 15:34:50 |\n|         5 | Alvin Greene         |      1200 | 2017-08-16 15:34:50 |\n|         8 | Donald D. Chamberlin |      2400 | 2017-08-16 15:35:33 |\n+-----------+----------------------+-----------+---------------------+\n5 rows in set (0.00 sec)</code></pre>\n      </div>\n<p>*As with all of these SQL things there is MUCH MORE to them than what’s in this introductory guide.  </p>\n<p>I hope this at least gives you enough to get started.  </p>\n<p>Please see the manual for your database manager and have fun trying different options yourself.</p>',fields:{slug:"/sql/sql-where-clause/"},frontmatter:{title:"SQL Where Clause"}}},pathContext:{slug:"/sql/sql-where-clause/"}}}});
